package sortings;

import java.util.*;

//merge sort
public class practice {
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArrayList<String> list = new ArrayList<>();
		list.add("Deepak");
		list.add("Ramesh");
		list.add("Mahesh");
		list.add("Mukesh");
		
		Iterator itr = list.iterator();
		
		while(itr.hasNext()) {
			System.out.println(itr);
		}
	}
}
